import React, { useState } from 'react';
import Navbar from './Navbar';
import mockData from './mockData';

import { makeStyles } from '@material-ui/core/styles';
import { 
    Button, 
    Card, 
    CardActions, 
    CardContent, 
    CardMedia, 
    CircularProgress,
    Grid, 
    Paper, 
    Typography,
} from '@material-ui/core';



const useStyles = makeStyles({
    card_root: {
        minWidth: 275,
        borderRadius: 0,
    },
    card_actions: {
        justifyContent: 'center',
    },
    media: {
        height: 0,
        paddingTop: '100%', 
    }, 
    card_text: {
        textAlign: 'center',
        textDecoration: "none",
    },
    link: {
        textDecoration: "none",
    },
  });


const GetPokemonCard = () => {
    const classes = useStyles();

    return (
        <Grid item xs={12} sm={4} >
            <CardActions className={classes.card_actions}>
                <Card className={classes.card_root} >
                    <a href="google.com" className={classes.link}>
                        <CardContent>
                            <CardMedia
                                className={classes.media}
                                image="https://cdn.bulbagarden.net/upload/thumb/7/7e/006Charizard.png/1200px-006Charizard.png"
                                title="pokemon"
                            />
                            <Typography variant="h6" component="h2" className={classes.card_text}>
                            test
                            </Typography>
                        </CardContent>
                    </a>
                </Card>
            </CardActions>
        </Grid>
    )
}  

const PokeDex = () => {
    const [pokemonData, setPokemonData] = useState(mockData);
    return (
        <>
            <Navbar />
            {pokemonData ? (
                <Grid container>
                    {GetPokemonCard()}

                </Grid>
            ) : (
                <CircularProgress />
            )}
        </>
    );
}

export default PokeDex;
